import React, { useState } from "react";

import { Link } from "react-router-dom";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faYoutube } from "@fortawesome/free-brands-svg-icons";
import {
  faEnvelope,
  faComment,
  faMap,
  faShoppingBag,
  faUser,
  faCheckSquare,
  faClipboardList,
  faCalendar,
  faStickyNote,
  faFire,
  faUserPlus,
  faBraille,
  faChartLine,
  faLeaf,
  faBolt,
  faThumbsUp,
  faBars,
  faChevronDown,
} from "@fortawesome/free-solid-svg-icons";
import classes from "../SideBar/SideBar.module.css";

const SideBar = (props) => {
  const [isShown, setIsShown] = useState(false);
  const [isMaps, setIsMaps] = useState(false);
  const [isFirestore, setIsFirestore] = useState(false);
  const [isCharts, setIsCharts] = useState(false);
  const [isForms, setIsForms] = useState(false);
  const [isUI, setIsUI] = useState(false);
  const [isAdvanced, setIsAdvanced] = useState(false);
  const [isFeedback, setIsFeedback] = useState(false);
  const [isTables, setIsTables] = useState(false);

  const toggleMenu = () => {
    setIsShown(!isShown);
  };

  const toggleMaps = () => {
    setIsMaps(!isMaps);
  };

  const toggleFirestore = () => {
    setIsFirestore(!isFirestore);
  };

  const toggleCharts = () => {
    setIsCharts(!isCharts);
  };

  const toggleForms = () => {
    setIsForms(!isForms);
  };

  const toggleUI = () => {
    setIsUI(!isUI);
  };

  const toggleAdvanced = () => {
    setIsAdvanced(!isAdvanced);
  };

  const toggleFeedback = () => {
    setIsFeedback(!isFeedback);
  };

  const toggleTables = () => {
    setIsTables(!isTables);
  };

  return (
    <aside
      className={props.isShrinkedSidebar ? classes.shrinked : classes.aside}
    >
      <div>
        {!props.isShrinkedSidebar && (
          <div className={classes.logo}>
            <h3>Isomorphic</h3>
          </div>
        )}{" "}
        {props.isShrinkedSidebar && (
          <div className={classes["no-logo"]}>
            <FontAwesomeIcon icon={faBolt} />
          </div>
        )}
        <div className={classes.wrapper}>
          <div className={classes.content}>
            <ul
              className={
                props.isShrinkedSidebar ? classes["more-margin"] : null
              }
            >
              <li
                className={
                  props.isShrinkedSidebar
                    ? classes["menu-list-shrinked"]
                    : classes["menu-list"]
                }
              >
                <Link to="/email" className={classes.container}>
                  <div
                    className={
                      props.isShrinkedSidebar
                        ? classes["not-straight"]
                        : classes.straight
                    }
                  >
                    <FontAwesomeIcon icon={faEnvelope} />
                  </div>
                  <span
                    className={
                      props.isShrinkedSidebar
                        ? classes["no-text"]
                        : classes.text
                    }
                  >
                    <p>Email</p>
                  </span>
                </Link>
              </li>
              <li
                className={
                  props.isShrinkedSidebar
                    ? classes["menu-list-shrinked"]
                    : classes["menu-list"]
                }
              >
                <Link to="/chat" className={classes.container}>
                  <div
                    className={
                      props.isShrinkedSidebar
                        ? classes["not-straight"]
                        : classes.straight
                    }
                  >
                    <FontAwesomeIcon icon={faComment} />
                  </div>
                  <span
                    className={
                      props.isShrinkedSidebar
                        ? classes["no-text"]
                        : classes.text
                    }
                  >
                    <p>Chat</p>
                  </span>
                </Link>
              </li>
              <li className={classes.item}>
                <Link
                  to="/ecommerce"
                  className={classes["container-item"]}
                  onClick={toggleMenu}
                >
                  <div
                    className={
                      props.isShrinkedSidebar
                        ? classes["not-straight"]
                        : classes.straight
                    }
                  >
                    <FontAwesomeIcon icon={faShoppingBag} />
                  </div>
                  <span
                    className={
                      props.isShrinkedSidebar
                        ? classes["no-text"]
                        : classes.text
                    }
                  >
                    <p>Ecommerce</p>
                  </span>
                  {!props.isShrinkedSidebar && (
                    <FontAwesomeIcon
                      icon={faChevronDown}
                      className={classes.chevron}
                    />
                  )}
                  {props.isShrinkedSidebar && null}
                </Link>
                {isShown && (
                  <ul className={classes.list}>
                    <li className={classes.items}>
                      <Link to="/ecommerce/shop">Shop</Link>
                    </li>
                    <li className={classes.items}>
                      <Link to="/ecommerce/cart">Cart</Link>
                    </li>
                    <li className={classes.items}>
                      <Link to="/ecommerce/checkout">Checkout</Link>
                    </li>
                    <li className={classes.items}>
                      <Link to="/ecommerce/cards">Cards</Link>
                    </li>
                  </ul>
                )}
              </li>
              <li>
                <Link
                  to="/maps"
                  className={classes["container-item"]}
                  onClick={toggleMaps}
                >
                  <div
                    className={
                      props.isShrinkedSidebar
                        ? classes["not-straight"]
                        : classes.straight
                    }
                  >
                    <FontAwesomeIcon icon={faMap} />
                  </div>
                  <span
                    className={
                      props.isShrinkedSidebar
                        ? classes["no-text"]
                        : classes.text
                    }
                  >
                    <p>Maps</p>
                  </span>
                  {!props.isShrinkedSidebar && (
                    <FontAwesomeIcon
                      icon={faChevronDown}
                      className={classes.chevron}
                    />
                  )}
                  {props.isShrinkedSidebar && null}
                </Link>
                {isMaps && (
                  <ul className={classes.list}>
                    <li className={classes.items}>
                      <Link to="/ecommerce/google-map">Google Map</Link>
                    </li>
                    <li className={classes.items}>
                      <Link to="/ecommerce/leaflet-map">Leaflet Map</Link>
                    </li>
                  </ul>
                )}
              </li>
              <li
                className={
                  props.isShrinkedSidebar
                    ? classes["menu-list-shrinked"]
                    : classes["menu-list"]
                }
              >
                <Link to="/profile" className={classes.container}>
                  <div
                    className={
                      props.isShrinkedSidebar
                        ? classes["not-straight"]
                        : classes.straight
                    }
                  >
                    <FontAwesomeIcon icon={faUser} />
                  </div>
                  <span
                    className={
                      props.isShrinkedSidebar
                        ? classes["no-text"]
                        : classes.text
                    }
                  >
                    <p>Profile</p>
                  </span>
                </Link>
              </li>
              <li
                className={
                  props.isShrinkedSidebar
                    ? classes["menu-list-shrinked"]
                    : classes["menu-list"]
                }
              >
                <Link to="/scrum-board" className={classes.container}>
                  <div
                    className={
                      props.isShrinkedSidebar
                        ? classes["not-straight"]
                        : classes.straight
                    }
                  >
                    <FontAwesomeIcon icon={faCheckSquare} />
                  </div>
                  <span
                    className={
                      props.isShrinkedSidebar
                        ? classes["no-text"]
                        : classes.text
                    }
                  >
                    <p>Scrum Board</p>
                  </span>
                </Link>
              </li>
              <li
                className={
                  props.isShrinkedSidebar
                    ? classes["menu-list-shrinked"]
                    : classes["menu-list"]
                }
              >
                <Link to="/invoice" className={classes.container}>
                  <div
                    className={
                      props.isShrinkedSidebar
                        ? classes["not-straight"]
                        : classes.straight
                    }
                  >
                    <FontAwesomeIcon icon={faClipboardList} />
                  </div>
                  <span
                    className={
                      props.isShrinkedSidebar
                        ? classes["no-text"]
                        : classes.text
                    }
                  >
                    <p>Invoice</p>
                  </span>
                </Link>
              </li>
              <li
                className={
                  props.isShrinkedSidebar
                    ? classes["menu-list-shrinked"]
                    : classes["menu-list"]
                }
              >
                <Link to="/youtube-search" className={classes.container}>
                  <div
                    className={
                      props.isShrinkedSidebar
                        ? classes["not-straight"]
                        : classes.straight
                    }
                  >
                    <FontAwesomeIcon icon={faYoutube} />
                  </div>
                  <span
                    className={
                      props.isShrinkedSidebar
                        ? classes["no-text"]
                        : classes.text
                    }
                  >
                    <p>Youtube Search</p>
                  </span>
                </Link>
              </li>
              <li
                className={
                  props.isShrinkedSidebar
                    ? classes["menu-list-shrinked"]
                    : classes["menu-list"]
                }
              >
                <Link to="/calendar" className={classes.container}>
                  <div
                    className={
                      props.isShrinkedSidebar
                        ? classes["not-straight"]
                        : classes.straight
                    }
                  >
                    <FontAwesomeIcon icon={faCalendar} />
                  </div>
                  <span
                    className={
                      props.isShrinkedSidebar
                        ? classes["no-text"]
                        : classes.text
                    }
                  >
                    <p>Calendar</p>
                  </span>
                </Link>
              </li>
              <li
                className={
                  props.isShrinkedSidebar
                    ? classes["menu-list-shrinked"]
                    : classes["menu-list"]
                }
              >
                <Link to="/notes" className={classes.container}>
                  <div
                    className={
                      props.isShrinkedSidebar
                        ? classes["not-straight"]
                        : classes.straight
                    }
                  >
                    <FontAwesomeIcon icon={faStickyNote} />
                  </div>
                  <span
                    className={
                      props.isShrinkedSidebar
                        ? classes["no-text"]
                        : classes.text
                    }
                  >
                    <p>Notes</p>
                  </span>
                </Link>
              </li>
              <li
                className={
                  props.isShrinkedSidebar
                    ? classes["menu-list-shrinked"]
                    : classes["menu-list"]
                }
              >
                <Link to="/todos" className={classes.container}>
                  <div
                    className={
                      props.isShrinkedSidebar
                        ? classes["not-straight"]
                        : classes.straight
                    }
                  >
                    <FontAwesomeIcon icon={faCheckSquare} />
                  </div>
                  <span
                    className={
                      props.isShrinkedSidebar
                        ? classes["no-text"]
                        : classes.text
                    }
                  >
                    <p>Todos</p>
                  </span>
                </Link>
              </li>
              <li>
                <Link
                  to="/firestore-curd"
                  className={classes["container-item"]}
                  onClick={toggleFirestore}
                >
                  <div
                    className={
                      props.isShrinkedSidebar
                        ? classes["not-straight"]
                        : classes.straight
                    }
                  >
                    <FontAwesomeIcon icon={faFire} />
                  </div>
                  <span
                    className={
                      props.isShrinkedSidebar
                        ? classes["no-text"]
                        : classes.text
                    }
                  >
                    <p>Firestore CURD</p>
                  </span>
                  {!props.isShrinkedSidebar && (
                    <FontAwesomeIcon
                      icon={faChevronDown}
                      className={classes.chevron}
                    />
                  )}
                  {props.isShrinkedSidebar && null}
                </Link>
                {isFirestore && (
                  <ul className={classes.list}>
                    <li className={classes.items}>
                      <Link to="/ecommerce/articles">Articles</Link>
                    </li>
                    <li className={classes.items}>
                      <Link to="/ecommerce/investors">Investors</Link>
                    </li>
                  </ul>
                )}
              </li>
              <li
                className={
                  props.isShrinkedSidebar
                    ? classes["menu-list-shrinked"]
                    : classes["menu-list"]
                }
              >
                <Link to="/contacts" className={classes.container}>
                  <div
                    className={
                      props.isShrinkedSidebar
                        ? classes["not-straight"]
                        : classes.straight
                    }
                  >
                    <FontAwesomeIcon icon={faUserPlus} />
                  </div>
                  <span
                    className={
                      props.isShrinkedSidebar
                        ? classes["no-text"]
                        : classes.text
                    }
                  >
                    <p>Contacts</p>
                  </span>
                </Link>
              </li>
              <li
                className={
                  props.isShrinkedSidebar
                    ? classes["menu-list-shrinked"]
                    : classes["menu-list"]
                }
              >
                <Link to="/shuffle" className={classes.container}>
                  <div
                    className={
                      props.isShrinkedSidebar
                        ? classes["not-straight"]
                        : classes.straight
                    }
                  >
                    <FontAwesomeIcon icon={faBraille} />
                  </div>
                  <span
                    className={
                      props.isShrinkedSidebar
                        ? classes["no-text"]
                        : classes.text
                    }
                  >
                    <p>Shuffle</p>
                  </span>
                </Link>
              </li>
              <li>
                <Link
                  to="/charts"
                  className={classes["container-item"]}
                  onClick={toggleCharts}
                >
                  <div
                    className={
                      props.isShrinkedSidebar
                        ? classes["not-straight"]
                        : classes.straight
                    }
                  >
                    <FontAwesomeIcon icon={faChartLine} />
                  </div>
                  <span
                    className={
                      props.isShrinkedSidebar
                        ? classes["no-text"]
                        : classes.text
                    }
                  >
                    <p>Charts</p>
                  </span>
                  {!props.isShrinkedSidebar && (
                    <FontAwesomeIcon
                      icon={faChevronDown}
                      className={classes.chevron}
                    />
                  )}
                  {props.isShrinkedSidebar && null}
                </Link>
                {isCharts && (
                  <ul className={classes.list}>
                    <li className={classes.items}>
                      <Link to="/ecommerce/google-carts">Google Carts</Link>
                    </li>
                    <li className={classes.items}>
                      <Link to="/ecommerce/recharts">Recharts</Link>
                    </li>
                    <li className={classes.items}>
                      <Link to="/ecommerce/react-chart-2">React-Chart-2</Link>
                    </li>
                    <li className={classes.items}>
